import * as s__ from "./style";
import {SocketIOClient} from "./../../modules/socketio-client/socketio-client";
import SendIcon from '@material-ui/icons/Send';
import FacebookIcon from '@material-ui/icons/Facebook';
import MailOutlineIcon from '@material-ui/icons/MailOutline';
import ChartData from '../ChartData/index';

class ChartSection extends Component<{},{}>{
    data1={
    header:"This is header",
    xAsis:[1500, 1600, 1700, 1750, 1800, 1850, 1900, 1950, 1999, 2050],
    datas:[{
      labelName:"A",
      data:[86, 114, 106, 106, 107, 111, 133, 221, 783, 2478],
    },{
      labelName:"B",
      data:[282, 350, 411, 502, 635, 809, 947, 1402, 3700, 4267],
    },{
      labelName:"C",
      data:[168, 170, 178, 190, 203, 276, 408, 547, 675, 734],
    },{
      labelName:"D",
      data:[40, 20, 10, 16, 24, 38, 74, 167, 508, 784],
    }]
  }
  componentDidMount(){
    console.log()

  }
  render() {
    // data={{dataLine:this.data1}}
    return (
      <s__.Footer>
        <s__.Container>
          <h2>Chart</h2>
          <s__.ChartsPlace>
            <ChartData typeChart="Bar" color={[]} />
            <ChartData typeChart="Line" color={[]}/>
            <ChartData typeChart="Doughnut" color={[]}/> 
            <ChartData typeChart="Bar" color={[]}/> 
          </s__.ChartsPlace>
        </s__.Container>
      </s__.Footer>
    );
  }
}

export default ChartSection;
